import React from "react";
import about from "./about.css";
import propic from "./propic.jpg";
const About = () => {
  return (
    <section className="sec">
      <div className="jumbotron">
        <div className="details">
          <img className="img-fluid pro-photo" src={propic} />
          <h3 className="display-7">Md Shahriar Rahman</h3>
          <p className="lead">
            I am a software developer experienced in various programming
            languages and frameworks. Welcome to my portfolio.
          </p>
        </div>
        <div className="degree">Bsc, Computing Science</div>
          <a className="school" href="https://sfu.ca">
            Simon Fraser University
          </a>
        <hr className="my-4" />
      </div>
    </section>
  );
};

export default About;
